import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsx mdx */



const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1>{`Understanding Type 2 Diabetes`}</h1>
    <p>{`Our bodies use glucose as fuel by taking glucose into cells, the
building blocks of our body, and changing the glucose into energy.`}</p>
    <p>{`Glucose does not go into our cells on its own. It needs a very important
hormone called insulin to enter the cells of our body.`}</p>
    <p>{`In most diabetics there is an excess of insulin in the blood, but the
cells do not respond well to the hormone insulin.`}</p>
    <p>{`When the body does not respond normally to the insulin signal, excess
sugars build up in the blood instead of going into the tissue cells.`}</p>
    <p>{`When the cells of the body do not respond well to the hormone insulin,
the condition is called insulin resistance.`}</p>
    <p>{`Insulin resistance leads to high levels of sugar in the blood
(hyperglycemia).`}</p>
    <p>{`The effect of prolonged high blood sugar levels can cause many health
problems which we will discuss later.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
